import React , {Component} from 'react';


export default class Toolbar  extends Component {

 render(){
         return (

            <div className="rtl nav-scroller py-1 mb-2 navbar_style " style={{height:'100%'}} >
            <nav className="rtl nav d-flex justify-content-between" style={{padding:'inherit'} } >
              <a className="rtl p-2 text-muted" href="#">World</a>
              <a className="rtl p-2 text-muted" href="#">U.S.</a>
              <a className="rtl p-2 text-muted" href="#">Technology</a>
              <a className="rtl p-2 text-muted" href="#">Design</a>
              <a className="rtl p-2 text-muted" href="#">Culture</a>
              <a className="rtl p-2 text-muted" href="#">Business</a>
              <a className="rtl p-2 text-muted" href="#">Politics</a>
              <a className="rtl p-2 text-muted" href="#">Opinion</a>
              <a className="rtl p-2 text-muted" href="#">Science</a>
              <a className="rtl p-2 text-muted" href="#">Health</a>
              <a className="rtl p-2 text-muted" href="#">Style</a>
              <a className="rtl p-2 text-muted" href="#">Travel</a>
            </nav>
          </div>

            );
        }
    }
